import Link from "next/link";
import { Navbar } from 'react-bootstrap';

const linkStyle = {
  marginRight: 15
};

const Menu = () => (
  <div className="links">
    <Navbar>
    <Link href="/">
      <a style={linkStyle}>Home</a>
    </Link>
    <Link href="/about">
      <a style={linkStyle}>About</a>
    </Link>
    <Link href="/projects">
      <a style={linkStyle}>Projects</a>
    </Link>
    <Link href="/contact">
      <a style={linkStyle}>Contact</a>
    </Link>
    </Navbar>
    <style jsx>{`
      .links {
        padding: 10px;
        border-bottom: 1px solid lightgray;
        margin-bottom: 10px;
      }
    `}</style>
  </div>
);

export default Menu;
